import styles from "./index.module.css";

export const Favorites = () => {
  return;
  <>
    <Header />
    <Banner image={"home"} />
    <Title>
      <h1>Um lugar para salvar seus v√≠deos e filmes</h1>
    </Title>
    <section className={styles.container}>
      {movies.map((movie) => {
        return <Card {...movie} key={movie.id} />;
      })}
    </section>
    <Footer />
  </>;
};
